import React from 'react';
import { Link } from 'react-router-dom';

const HomePage: React.FC = () => {
  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gradient-to-br from-blue-50 to-gray-100 p-6">
      <h1 className="text-5xl font-extrabold mb-4 text-gray-800 text-center">
        Welcome to the Store Rating & Review System
      </h1>

      <p className="text-lg mb-8 text-gray-700 text-center max-w-xl">
        Browse and rate your favorite stores. Share your experiences and explore top-rated stores near you!
      </p>

      <div className="flex flex-col sm:flex-row gap-4">
        <Link
          to="/login"
          className="px-6 py-3 bg-blue-500 text-white font-semibold rounded-lg shadow hover:bg-blue-600 transition"
        >
          Login
        </Link>

        <Link
          to="/signup"
          className="px-6 py-3 bg-green-500 text-white font-semibold rounded-lg shadow hover:bg-green-600 transition"
        >
          Sign Up
        </Link>
      </div>
    </div>
  );
};

export default HomePage;
